Defendant Dominique Lavelle Williams in court with Attorney Cole J White.  Defendant Dominique Lavelle Williams in custody.  Denis John Stingl appeared for the State of Wisconsin.

Matter here for sentencing.  Sentencing proceeded.  Statements by the State, defense and defendant.  AS TO COUNT #4:  The Court imposed the following sentence:  The Defendant's TOTAL LENGTH OF SENTENCE shall be THREE AND A HALF (3 1/2) years CONCURRENT to #15CF5498.  Defendant's TERM OF CONFINEMENT in the Wisconsin Prison System shall be for ONE AND A HALF (1 1/2) years with credit for FIVE HUNDRED TWENTY-SIX (526) days time served.  Defendant shall serve TWO (2) years on EXTENDED SUPERVISION.  

AS TO COUNT #5:  The Court imposed the following sentence:  The Defendant's TOTAL LENGTH OF SENTENCE shall be THREE AND A HALF (3 1/2) years CONCURRENT to #15CF5498.  Defendant's TERM OF CONFINEMENT in the Wisconsin Prison System shall be for ONE AND A HALF (1 1/2) years.  Defendant shall serve TWO (2) years on EXTENDED SUPERVISION.  

The defendant IS eligible for the Challenge Incarceration Program;
The defendant IS eligible for the Wisconsin Substance Abuse Program.  

The Court advised the defendant of the determinate sentence pursuant to statute and in accordance with Form CR-234.  Copy provided to defendant. 

CONDITIONS OF EXTENDED SUPERVISION:
 - No controlled substances or alcohol;
 - AODA assessment; treatment, if needed;
 - Random urine screens to ensure compliance;
 - Pay the DNA surcharge, costs and disbursements.  Court ordered monies taken by the Department of Correction from up to 25% of prison funds.  Balance would be then be paid while on Extended Supervision.  Failure to pay amounts in full would result in a civil judgment entered against defendant.

